import React from "react";

export const Gallery = (props) => {
    const { view } = props;

    return (
        <div className="galleryView">
            <>

            {view.map((item) => (

                <img src="{item.image}" alt="test" />

            ))}
            </>
        </div>
    );
};   
export default Gallery;
